import { Breadcrumb, Row, Container } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useRouter } from "next/router";

const parseText = (text) => {
  var displayedText = true;

  for (var x = 0; x < text.length; x++) {
    var c = text.charAt(x);

    if (displayedText && c == "|") {
      text = text.substring(0, x);
    }
  }
  return text;
};

const FoldersHeaderBar = ({ title }) => {
  const router = useRouter();

  return (
    <Container className="grey-box">
      <Row className="folders-navigation">
        <Breadcrumb>
          <Breadcrumb.Item href="/">
            <FontAwesomeIcon icon={"home"} />
          </Breadcrumb.Item>
          {items.map((item) => (
            <Breadcrumb.Item href={`/${item}`}>
              {parseText(title)}
            </Breadcrumb.Item>
          ))}
        </Breadcrumb>
      </Row>
    </Container>
  );
};

export default FoldersHeaderBar;
